import "./App.css";
import freeLogo from "./img/freecodecamp-logo.png";

function App() {
  return (
    <div className="App">
      <div className="free-logo-contenedor">
        <img className="free-logo" src={freeLogo} alt="logo de free" />
      </div>
      <div className="contenedor-principal"></div>
    </div>
  );
}

export default App;
